import React, { Component } from 'react'
import { connect } from 'react-redux'
import Nav from './Nav'

class Dashboard extends Component {
    render() {
        const { authedUser, questions, users, answeredQuestions } = this.props
        console.log(unansweredQuestions)
        return(
            <div>
                <Nav />
                Dashboard
            </div>
        )
    }
}

function mapStateToProps({ authedUser, questions, users })  {

    const answeredQuestions = Object.keys(users[authedUser].answers).map((user) => question)
    .filter((question) => Object.keys(questions[question].optionOne.vote) !== authedUser)
    .sort((questionA, questionB) => questions[questionB].timestamp - questions[questionA.timestamp])

    return {
        authedUser, 
        questions,
        users,
        answeredQuestions,
    }
}

export default connect(mapStateToProps)(Dashboard)
